What is the complement of set A (A') in the universal set U?

Consider the following two sets:
Set A: {2, 4, 6, 8}
Set B: {x | x is an even number and 0 < x < 10}

Tom says Set A and Set B are the same because all elements in both sets are even numbers.
Katie says Set A and Set B are not the same because the elements in Set B are not limited to the numbers in Set A.

Who is correct?

